import {StyleSheet,Text, View} from 'react-native';

export default function Header() {
    return (
        <View style = {styles.main}>
            <Text style={styles.text}>Color Generate</Text>
        </View>
    )
}

const styles = StyleSheet.create({

    main: {
        paddingTop: 80,
        height: 120,
        backgroundColor: 'silver'
    },
    text: {
        fontSize: 18,
        color: 'red',
        textAlign: 'center'
    }

},
)
